import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTimes } from '@fortawesome/free-solid-svg-icons';
import './TransactionForm.css';

const TransactionForm = ({ 
  isOpen, 
  onClose, 
  onSubmit, 
  initialData = null, 
  categories = [],
  isSubmitting = false,
  error = ''
}) => {
  // Set initial form data based on whether we're adding or editing
  const formData = initialData ? {
    type: initialData.type,
    amount: initialData.amount.toString(),
    description: initialData.description,
    category: initialData.category,
    date: initialData.date.split('T')[0]
  } : {
    type: 'expense',
    amount: '',
    description: '',
    category: categories[0] || '',
    date: new Date().toISOString().split('T')[0]
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const form = e.target;
    const transactionData = {
      type: form.type.value,
      amount: parseFloat(form.amount.value),
      description: form.description.value,
      category: form.category.value,
      date: form.date.value
    };
    onSubmit(transactionData);
  };

  if (!isOpen) return null;

  return (
    <div className="modal-overlay" onClick={() => !isSubmitting && onClose()}>
      <div className="modal" onClick={e => e.stopPropagation()}>
        <div className="modal-header">
          <h2>{initialData ? 'Edit Transaction' : 'Add Transaction'}</h2>
          <button 
            className="close-btn" 
            onClick={() => !isSubmitting && onClose()} 
            disabled={isSubmitting}
          >
            <FontAwesomeIcon icon={faTimes} />
          </button>
        </div>
        
        {error && <div className="form-error">{error}</div>}

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Transaction Type</label>
            <div className="radio-group">
              <label>
                <input
                  type="radio"
                  name="type"
                  value="expense"
                  defaultChecked={formData.type === 'expense'}
                  disabled={isSubmitting}
                />
                Expense
              </label>
              <label>
                <input
                  type="radio"
                  name="type"
                  value="income"
                  defaultChecked={formData.type === 'income'}
                  disabled={isSubmitting}
                />
                Income
              </label>
            </div>
          </div>

          <div className="form-group">
            <label>Amount ($)</label>
            <input
              type="number"
              name="amount"
              defaultValue={formData.amount}
              step="0.01"
              min="0"
              required
              disabled={isSubmitting}
            />
          </div>

          <div className="form-group">
            <label>Description</label>
            <input
              type="text"
              name="description"
              defaultValue={formData.description}
              required
              disabled={isSubmitting}
            />
          </div>

          <div className="form-group">
            <label>Category</label>
            <select
              name="category"
              defaultValue={formData.category}
              required
              disabled={isSubmitting}
            >
              {categories.map(category => (
                <option key={category} value={category}>
                  {category.charAt(0).toUpperCase() + category.slice(1)}
                </option>
              ))}
            </select>
          </div>

          <div className="form-group">
            <label>Date</label>
            <input
              type="date"
              name="date"
              defaultValue={formData.date}
              required
              disabled={isSubmitting}
            />
          </div>

          <div className="form-actions">
            <button
              type="button"
              onClick={() => !isSubmitting && onClose()}
              className="btn btn-secondary"
              disabled={isSubmitting}
            >
              Cancel
            </button>
            <button
              type="submit"
              className="btn btn-primary"
              disabled={isSubmitting}
            >
              {isSubmitting ? 'Processing...' : initialData ? 'Update' : 'Add'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default TransactionForm;
